import React from "react";

class LikesCounter extends React.Component {
  render() {
    return (
      <>
        <input
          type="button"
          value="Dame 1 like"
          onClick={this.props.handleClick}
        />
        <h1>
          {this.props.stateNumber} <i className="fas fa-heart"> </i>
        </h1>
      </>
    );
  }
}

export default LikesCounter;
